#include <cstdio>
#include <memory>
#include <vector>
using namespace std;

class Solution {
public:
    int longestOnes(vector<int>& nums, int k) {
        int maxWindowLength = 0;
        for (int i = 0; i < nums.size(); i++) {
            int remainK = k;
            int curIndex = i;
            int windowLength = 0;
            if (curIndex + maxWindowLength > nums.size()) {
                break;
            }
            while (curIndex < nums.size()) {
                // printf("curIndex=%d, windowLength=%d, curIndex=%d, remainK=%d\n", curIndex, windowLength, curIndex, remainK);
                if (nums[curIndex] == 0) {
                    if (remainK > 0) {
                        remainK--;
                    } else {
                        break;
                    }
                }
                windowLength++;
                curIndex++;
            }
            // printf("i=%d, windowLength=%d\n", i, windowLength);
            if (windowLength > maxWindowLength) {
                maxWindowLength = windowLength;
            }
        }
        return maxWindowLength;
    }
};

